class Solution(object):
    def maximumSum(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        sumOfDigits = {}
        for num in nums:
            originalNum = num
            sumOfDigit = 0
            while num != 0:
                sumOfDigit += num % 10
                num = num // 10
            if sumOfDigit not in sumOfDigits:
                sumOfDigits[sumOfDigit] = [originalNum]
            elif len(sumOfDigits[sumOfDigit]) == 1:
                if originalNum > sumOfDigits[sumOfDigit][0]:
                    sumOfDigits[sumOfDigit].insert(0, originalNum)
                else:
                    sumOfDigits[sumOfDigit].append(originalNum)
            else:
                if originalNum > sumOfDigits[sumOfDigit][0]:
                    sumOfDigits[sumOfDigit][1] = sumOfDigits[sumOfDigit][0]
                    sumOfDigits[sumOfDigit][0] = originalNum
                elif originalNum > sumOfDigits[sumOfDigit][1]:
                    sumOfDigits[sumOfDigit][1] = originalNum
        maxOfSums = -1
        for sumOfDigit in sumOfDigits:
            if len(sumOfDigits[sumOfDigit]) >= 2:
                if sumOfDigits[sumOfDigit][0] + sumOfDigits[sumOfDigit][1] > maxOfSums:
                    maxOfSums = sumOfDigits[sumOfDigit][0] + sumOfDigits[sumOfDigit][1]
        return maxOfSums


